import React, { useEffect } from "react";

const Headless = () => {
  useEffect(() => {
    const script = document.createElement("script");
    script.id = "otpless-sdk";
    script.src = "https://otpless.com/v2/headless.js";
    script.setAttribute("data-appid", "RM2I31PAOMTTAJ0UGFLP");
    script.onload = initializeSDK;
    document.head.appendChild(script);

    return () => {
      document.head.removeChild(script);
    };
  }, []);

  const initializeSDK = () => {
    const callback = (userinfo) => {
      const emailMap = userinfo.identities.find(
        (item) => item.identityType === "EMAIL"
      );
      const mobileMap = userinfo.identities.find(
        (item) => item.identityType === "MOBILE"
      )?.identityValue;
      const token = userinfo.token;
      const email = emailMap?.identityValue;
      const mobile = mobileMap?.identityValue;
      const name = emailMap?.name || mobileMap?.name;

      console.log(userinfo);
      // Implement your custom logic here.
    };

    window.OTPlessSignin = new OTPless(callback);
  };

  const phoneAuth = async () => {
    const phno = document.getElementById("mobile-input").value;
    console.log("called");

    const res = await window.OTPlessSignin.initiate({
      channel: "PHONE",
      phone: phno,
      countryCode: "+91",
    });

    alert(JSON.stringify(res));
  };

  const verifyOTP = async () => {
    const phno = document.getElementById("mobile-input").value;
    const otp = document.getElementById("otp-input").value;

    const res = await window.OTPlessSignin.verify({
      channel: "PHONE",
      phone: phno,
      otp: otp,
      countryCode: "+91",
    });

    alert(JSON.stringify(res));
  };

  const oAuth = async (params) => {
    const res = await window.OTPlessSignin.initiate({
      channel: "OAUTH",
      channelType: params,
    });

    alert(JSON.stringify(res));
  };

  return (
    <>
      <div id="mobile-section">
        <input id="mobile-input" placeholder="Enter mobile number" />
        <button onClick={phoneAuth}>Request OTP</button>
      </div>
      <div id="otp-section">
        <input id="otp-input" placeholder="Enter OTP" />
        <button onClick={verifyOTP}>Verify OTP</button>
      </div>
      <button onClick={() => oAuth("WHATSAPP")}>
        Authenticate with WhatsApp
      </button>
      <button onClick={() => oAuth("GMAIL")}>Authenticate with Gmail</button>
    </>
  );
};

export default Headless;
